  WHERE "createdAt" >= {{ currentTimeRange.value.start }}
    AND "createdAt" < {{ currentTimeRange.value.end }}
  GROUP BY id_of_saved_workflow
)

SELECT 
  workflow."id",
  workflow."name",
  workflow."isEnabled",
  workflow."createdAt",
  folders.name as "folderName",
  "count_workflow_saves",
  "count_workflow_runs"

FROM workflow
  JOIN saves_by_workflow on workflow.id = saves_by_workflow."id_of_saved_workflow"
  JOIN runs_by_workflow on workflow.id = runs_by_workflow."id_of_ran_workflow"
  JOIN folders on workflow."folderId" = folders.id

where
    workflow.name ilike {{ '%' + WorkflowSearchInput.value + '%' }} 
  AND workflow."id" in (select id from workflow_ids)

order by
  count_workflow_runs desc nulls last
limit
  {{ MaxWorkflows.value}};
